import React, { Component } from 'react';
import './App.css';
import {useSprings, animated} from 'react-spring'
import {Spring} from 'react-spring/renderprops'








class App extends Component {







  render(){
    return(


      <Spring
  from={{ number: 0 }}
  to={{ number: 1 }}>
  {props => <div>{props.number}</div>}
</Spring>

    );
  }
}

export default App;
